import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Header = () => {

  const Nav = styled.nav`
    position: fixed;
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 100%;
    border-radius: 10px;
    background-color: #453C67;

  `;

  const NavLeft = styled.section`
    width: 50%;
    height: 100px;

  `;
  const NavRight = styled.section`
  width: 50%;
  height: 100px;

`;

const PrimaryMenu = styled.section`
width: 50%;
height: 100px;

`;


  

  return (
    <Nav>
      <NavLeft> 
         <PrimaryMenu>
            <WarcraftMenu>워크래프트</WarcraftMenu>
            <DiabloMenu>디아블로</DiabloMenu>
            <OverwatchMenu>오버워치</OverwatchMenu>
            <Starcraftmenu>스타크래프트</Starcraftmenu>


         </PrimaryMenu>
         </NavLeft>
      
      
      <NavRight> 
        <CompanyInfo>회사 소개</CompanyInfo>
        <Shop>상점</Shop>
        <Account>계정</Account>
        <InstallBtn />
      </NavRight>
    </Nav>
  );
};

export default Header;
